function TodoCheck({isDone, markTodoAsCompleted, text} ) {
    console.log(text + "_____")
    return (
        <TodoIcon
           type="check"
           color={isDone? 'green' : 'gray'}
           onClick={() => markTodoAsCompleted()}
       />        
    );
}
export {TodoCheck};
